import React from "react";
import { Typography, Grid } from "@mui/material";

const informations = [
  [formatDate(20230312), "コーラックを飲みました。今日も快便です。"],
  [formatDate(20230311), "便秘になりました。"],
  [formatDate(20230310), "痔の手術しました。今日も快便です"],
  [formatDate(20230309), "痔になりました。お尻が痛みます。"],
  [formatDate(20231231), "今日も快便です"],
];
function Downloads() {
  return (
    <div id="item_7" className="Downloads" style={{ height: "40vh" }}>
      <Grid
        container
        direction="column"
        justifyContent="center"
        alignItems="center"
      >
        <Grid item style={{ width: "50vw" }} xs={8}>
          <Typography variant="h4" align="center">
            各種ダウンロード
          </Typography>
          {informations.map((item: any, _index) => {
            return (
              <List key={_index}>
                <ListItem disablePadding>
                  <Grid container>
                    <ListItemButton
                      sx={{
                        textAlign: "left",
                        borderBottom: 0.5,
                        borderColor: "#e6e6e6",
                      }}
                    >
                      <Grid item>
                        <ListItemText primary={item[0]} />
                      </Grid>
                      <Grid>
                        <ListItemText primary={item[1]} />
                      </Grid>
                    </ListItemButton>
                  </Grid>
                </ListItem>
              </List>
            );
          })}
        </Grid>
      </Grid>
    </div>
  );
}

export default Downloads;
